import React, { Component } from 'react';
import './App.css';


class First extends Component {
  constructor (props) {
    super(props)
    this.state = {
      response: '',
      post: '',
      responseToPost: '',
    }
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
        เที่ยวไหนดี?
        </header>
        <div className='App-body'>
          <div>
            ใส่งบประมาณ หรือ ชื่อประเทศที่อยากเที่ยว
          </div>
          <div>
            <input type="text"/>
          </div>
          <div>
            <button>หาเลย</button>
          </div>
        </div>
      </div>
    );
  }
}

export default First;
